  false,\n\t\"url\": null,\n\t\"notes\": \"This study was designed to achieve three
  goals which would assist future refuge management and serve to focus further study:
  1) identify toxic contaminants present in streams flowing into the refuge; 2) characterize
  ambient concentrations of elemental contaminants, organochlorines, and PAHs in GSNWR
  sediment and fish to serve as baseline data for future reference and planning; and,
  3) identify elemental contaminant, organochlorine, and PAH contamination within
  GSNWR arising from the identified dumps, sewage treatment plants, and other potential
  contaminant sources (Long Hill Road, unidentified dumps, residential and business
  park development, and agriculture).\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
